import "./Home.css";
import Social from "./Social";
import Navbar from "./Navbar";

function Home() {
  return (
    <>
      <style>
        {`
          html, body {
            background-image: linear-gradient(rgba(0, 0, 0, 0.527),rgba(0, 0, 0, 0.5)), url("https://pbs.twimg.com/media/FS958IEUYAEk2yT?format=jpg&name=4096x4096");
            /* background-size: cover; */
            background-size: 100vw 100vh;
            background-repeat: no-repeat;
            height: fit-content;
        `}
      </style>
      <div className="all">
        <Navbar />
        <div className="text">
          <div className="text-kr">
            <h1>갓세븐</h1>
          </div>
          <div className="text-en">
            <h1>GOT7</h1>
          </div>
        </div>
        <div className="home-button">
          <button>HOME FEED</button>
        </div>
        <div className="link" style={{marginTop:""}}>
        <Social />
        </div>
      </div>
    </>
  );
}
export default Home;
